import ListEquipment from './components/List_equipment';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Home, Revision, Additions, Transfer} from './pages/pages';

function App() {
  return (
    <div>
        <Routes>
          <Route exact path="/" component={<Home/>}/>
        </Routes>
    </div>
  );
}

export default App;
